import React, { Component } from "react"
import { Layout } from "~/components/Layout/Layout"
import Card from '../components/card/card'

import { stateTop } from '../state/state'

export default class extends Component {

  topToProps() {
    return stateTop.map(item => {
      return (
        <div className={`col ${item.className}`}>
          <Card />
        </div>
      )
    })
  }

  render() {
    return (
      <Layout>
        <div className="container">
          <h2>ТОП 10 мест</h2>

          <div className="row">

          </div>
        </div>
      </Layout>
    )
  }
}
